  let linkToAPI = 'https://johnnylaicode.github.io/api/credits.json';
  let yea = this.props.creditList;

  return (
    <div>
      <h1>Credits</h1>
        <div className = "test">
          {
            this.state.yea.map((user) => {
                return(
                  <div key = {user.id}>
                    <h3>
                      Name{user.id}: {user.description}
                    </h3>
                  </div>
                )
              }
            )
          }
        </div>
      <br/>
      <Link to="/">Return to Home</Link>
    </div>
  );
}

